	public class CrystalCave : ModWorld
	{	
		public override void ModifyWorldGenTasks(List<GenPass> tasks, ref float totalWeight) 
		{
			int LivingTreesIndex = tasks.FindIndex(genpass => genpass.Name.Equals("Living Trees"));
			if (LivingTreesIndex != -1) 
			{
				tasks.Insert(LivingTreesIndex + 1, new PassLegacy("Post Terrain", delegate (GenerationProgress progress) 
				{
					progress.Message = "Crystallizing the Caverns";
					MakeCrystalCaves();
				}));
			}
		}
		//Ruined Homes
		private void MakeCrystalCaves() 
		{
			int widthScale = Main.maxTilesX / 4200;
			int numberToGenerate = 1;
			for (int k = 0; k < numberToGenerate; k++) 
			{
				bool success = false;
				int attempts = 0;
				while (!success) 
				{
					attempts++;
					if (attempts > 1000) 
					{
						success = true;
						continue;
					}
					int i = WorldGen.genRand.Next(Main.maxTilesX / 2 - 600, Main.maxTilesX / 2 + 600);
					int j = Main.maxTilesY / 2;
					bool placementOK = true;
					for (int l = i - 40; l < i + 40; l++) 
					{
						for (int m = j - 18; m < j + 21; m++) 
						{
							int type = (int)Main.tile[l, m].type;
							if (type == TileID.BlueDungeonBrick || type == TileID.GreenDungeonBrick || type == TileID.PinkDungeonBrick || type == TileID.Cloud || type == TileID.RainCloud || type == 368 || type == 367 || type == 226)
							{
								placementOK = false;
							}
						}
					}
					if (placementOK) 
					{
						success = PlaceCrystalCave(i, j);
						//WorldGen.PlaceTile(i, j, ModLoader.GetMod("OrionsMod").TileType("Crystalline_Lifesap_Tile"));
						//WorldGen.PlaceObject(i + 9, j + 8, 187, true, 17);
						//apparently this is referenced from the top of the structure
					}
				}
			}
		}
